import './Comment.scss';

function Comment() {
  return (
    <li className="commentList">
      <div className="commentBox">
        <span className="commentName" />
        <div className="userComment" />
      </div>
      <i className="far fa-heart" />
    </li>
  );
}

export default Comment;
